import React, { Component } from "react";
 
class Project extends Component {
  render() {
    return (
      <div>
        <h2>Project</h2>
        <p>I have done differnt project:</p>
        <ol>
          <li>online reporting tools </li>
          <li>Billing of medical prescription (APClinic)</li>
          <li>Online Dtata Collection (Water Point Mapping)</li>
          <li>I did all this using diffent programing languages</li>
        </ol>
        
      </div>


    );
  }
}
 
export default Project;
